import React from 'react'
import { useSelector } from 'react-redux'

export function FavoritesList() {
    const { favorites } = useSelector(state => state.listModule)
    return (
        <div>
            {favorites.map(video => {
                return <div
                    key={video.id.videoId}>
                    <h1>{video.snippet.title}</h1>
                </div>
            })}
        </div>
    )
}
